import "./card.styles.css";

const Card = ({ monster }) => {
  // const { id, email, name } = monster;
  return (
    <div className="card-container" key={monster.id}>
      <img
        alt={`monster ${monster.name}`}
        src={`https://robohash.org/${monster.id}?set=set2&size=180x180`}
      />
      <h2>{monster.name}</h2>
      <p>{monster.email}</p>
    </div>
  );
};

export default Card;
